import { useState } from "react";
import ReactDatePicker from "react-datepicker";

const DatePick = () => {
  const [startDate, setStartDate] = useState(new Date());
  return (
    <ReactDatePicker
      dateFormat="yyyy/MM/dd"
      selected={startDate}
      onChange={(date) => setStartDate(date)}
    />
  );
};

export default DatePick;
